import { Link } from "react-router-dom";

const News = () => {

    return (
        <section className="sectionWrapper">
            <Link to="/">Home</Link>
            <br/>
            <h1>Upcoming Features: </h1>
            <br/>
            <p>Search friends by horoscope sign.</p>
            <br/>
            <p>Private Messaging.</p>
                    
            
                    
            
        </section>
    )
}

export default News;
